var TempusersArray = [];
var isTCC = "@townsville.qld.gov.au";
var isBRS = "bigredskysa";
//Set users array to incoming page user list
usersArray = data.get(8).output.data.object.users;
var parser = new global.JSON();
//loop through userlist add to temp array
for (var record = 0; record < usersArray.length; record++) {
    //filter includes only tcc emails, excludes BRS SA accounts
    if (usersArray[record].email != null && usersArray[record].email.indexOf(isTCC) > -1 && (usersArray[record].username.indexOf(isBRS) == -1 && usersArray[record].username != null)) {
        //workflow.info("Is TCC User "+ record);	

        TempusersArray.push(usersArray[record]);

    }
}
//Stringify userlist for string replace
var str = parser.encode(TempusersArray);
var jString = global.JSON.stringify(str);
//replace [] from incoming user list and push list of objects into scratchpad array
workflow.scratchpad.userlistArray.push(parser.decode(jString.replace("[", "").replace("]", "")));

if (workflow.scratchpad.debugging == 'true') {
    workflow.info("BRS USERS username [" + workflow.scratchpad.userlistArray + "]");
    workflow.info("BRS USERS data.get(8).output.links.next.toString() " + data.get(8).output.links.next);
